import React from 'react'

export default function Card(props) {

    return (
      <div style={styleCard}>
          <h1 style={{fontSize : '32px',}}>{props.item.title}</h1>
          <p style={{textAlign : 'left'}}>{props.item.body}</p>
      </div>
      )
}


let styleCard ={

    width : '800px',
    height: '400px',
    background: 'green',
    border : 'solid 2px black',
    borderRadius: '30px',
    padding:'40px',
    marginBottom : '50px'
}
